document.addEventListener("DOMContentLoaded", function () {
    showSection("home");
    displayStudents();

    // Event Listeners
    document.getElementById("addStudentButton").addEventListener("click", function () {
        showSection("add-student");
    });

    document.getElementById("cancelButton").addEventListener("click", function () {
        showSection("home");
    });

    document.getElementById("saveButton").addEventListener("click", function () {
        // Get form values
        const name = document.getElementById("name").value;
        const fatherName = document.getElementById("fatherName").value;
        const admissionNumber = document.getElementById("admissionNumber").value;
        const studentClass = document.getElementById("class").value;
        const section = document.getElementById("section").value;

        // Collect marks
        const marks = [];
        for (let i = 1; i <= 5; i++) {
            const exam1 = parseFloat(document.getElementById(`subject${i}_exam1`).value);
            const exam2 = parseFloat(document.getElementById(`subject${i}_exam2`).value);

            // Validate marks
            if (isNaN(exam1) || exam1 < 0 || exam1 > 50 || isNaN(exam2) || exam2 < 0 || exam2 > 50) {
                alert("Please enter valid marks (0-50) for all subjects.");
                return;
            }
            marks.push({ subject: `Subject ${i}`, exam1: exam1, exam2: exam2 });
        }

        // Validate required fields
        if (!name || !fatherName || !admissionNumber || !studentClass || !section) {
            alert("Please fill in all required fields.");
            return;
        }

        // Create student object
        const student = {
            name,
            fatherName,
            admissionNumber,
            class: studentClass,
            section,
            marks
        };

        // Save to localStorage
        const students = JSON.parse(localStorage.getItem("students")) || [];
        students.push(student);
        localStorage.setItem("students", JSON.stringify(students));

        // Generate PDF
        generatePDF(student);

        // Return to home and update list
        showSection("home");
        displayStudents();
    });
});

function showSection(sectionId) {
    document.getElementById("home").classList.add("d-none");
    document.getElementById("add-student").classList.add("d-none");
    document.getElementById(sectionId).classList.remove("d-none");
    if (sectionId === "add-student") {
        document.getElementById("studentForm").reset();
    }
}

function displayStudents() {
    const students = JSON.parse(localStorage.getItem("students")) || [];
    const tableBody = document.getElementById("studentTableBody");
    tableBody.innerHTML = "";

    students.forEach((student, index) => {
        const row = document.createElement("tr");
        row.innerHTML = `
            <td>${student.name}</td>
            <td>${student.admissionNumber}</td>
            <td><button class="btn btn-primary generate-pdf" data-index="${index}">Generate Report Card</button></td>
        `;
        tableBody.appendChild(row);
    });

    // Add event listeners to generate buttons
    document.querySelectorAll(".generate-pdf").forEach(button => {
        button.addEventListener("click", function () {
            const index = parseInt(this.getAttribute("data-index"));
            const students = JSON.parse(localStorage.getItem("students")) || [];
            generatePDF(students[index]);
        });
    });
}

function generatePDF(student) {
    const { jsPDF } = window.jspdf;
    const doc = new jsPDF({
        orientation: 'portrait', // or 'landscape'
        unit: 'mm', // Choose units: 'mm', 'cm', 'in', 'px', 'pt'
        format: [210, 297] // Custom width & height
    });
    
    // Set font to Helvetica (sans-serif)
    doc.setFont('helvetica');
    

    // Define colors
    const lightBlue = '#ADD8E6';
    const darkBlue = '#0b5ed7';
    const lightGray = '#F0F0F0';
    const black = '#000000';
    const gray = '#808080';

    // Draw gray border around the entire page (A4 size: 595pt x 842pt)
    doc.setDrawColor(gray);
    doc.rect(10, 10, 190, 277, 'S'); // 10pt margin on all sides

    

    // **Header Section**
    doc.setFillColor(lightBlue);
    doc.roundedRect(20, 20, 170, 30, 5, 5, 'F'); // Light blue background, rounded corners
    doc.setTextColor(darkBlue);
    doc.setFontSize(24);
    doc.setFont('helvetica', 'bold');
    doc.text("STUDENT REPORT CARD", 105, 35,{align:"center"}); // Centered at page width/2
    doc.setTextColor(black);
    doc.setFontSize(12);
    doc.text("Academic Year 2024-2025", 105, 45, { align: 'center' });

    // **Student Details Section**
    doc.setFillColor(lightGray);
    doc.roundedRect(20, 60, 170, 50, 5, 5, 'F'); // Light gray background, rounded corners
    doc.setFont('helvetica', 'bold');
    doc.text("Student Details", 30, 70);
    doc.setFont('helvetica', 'normal');
    const leftColumnX = 30;
    const rightColumnX = 300;
    const lineHeight = 10;
    let y = 80;
    doc.text(`Name: ${student.name}`, leftColumnX, y);
    doc.text(`Class: ${student.class}`, rightColumnX, y);
    y += lineHeight;
    doc.text(`Father's Name: ${student.fatherName}`, leftColumnX, y);
    doc.text(`Section: ${student.section}`, rightColumnX, y);
    y += lineHeight;
    doc.text(`Admission No: ${student.admissionNumber}`, 297.5, y, { align: 'center' });

    // **Examination Results Section**
    doc.setFillColor(lightGray);
    doc.roundedRect(20, 120, 170, 115, 5, 5, 'F'); // Light gray background, rounded corners
    doc.setFont('helvetica', 'bold');
    doc.text("Examination Results", 30, 130);
    doc.setFont('helvetica', 'normal');

    // Prepare table data
    const tableColumns = ['Subject', 'Exam 1 (50)', 'Exam 2 (50)'];
    const tableRows = student.marks.map(m => [m.subject, m.exam1, m.exam2]);
    const totalExam1 = student.marks.reduce((sum, m) => sum + m.exam1, 0);
    const totalExam2 = student.marks.reduce((sum, m) => sum + m.exam2, 0);
    const totalMarks = totalExam1 + totalExam2;
    const maxMarks = 50 * student.marks.length * 2; // Dynamic based on number of subjects
    const percentage = ((totalMarks / maxMarks) * 100).toFixed(2);
    tableRows.push(['Total Marks', totalExam1, totalExam2]);

    // Draw table

    doc.autoTable({
        head: [tableColumns],
        body: tableRows,
        startY: 140,
        theme: 'grid', // Thin gray grid lines
        headStyles: { fillColor: lightBlue, textColor: black },
        styles: { font: 'helvetica', fontSize: 12 },
        margin: { left: 30, right: 30 }
    });



    // Summary lines below the table
    const tableEndY = doc.lastAutoTable.finalY;
    y = tableEndY + 10;
    doc.text(`Overall Percentage: ${percentage}%`, 30, y);
    y += lineHeight;
    doc.text(`Total Marks Obtained: ${totalMarks} out of ${maxMarks}`, 30, y);

    // **Disclaimer Section**
    const bottomY = 842 - 40; // Near bottom of A4 page
    doc.setFillColor(lightGray);
    doc.setDrawColor(lightBlue);
    doc.roundedRect(20, bottomY, 190, 30, 5, 5, 'FD'); // Light gray fill, light blue border
    doc.setTextColor(black);
    doc.text("This is a computer-generated document. No signature is required.", 297.5, bottomY + 15, { align: 'center' });
/*
    const img = new Image();
    img.src = 'school-logo.jpg'; // Path to your image file

    img.onload = function () {
        doc.addImage(img, 'JPG', 20, 10, 100, 100); // Add logo
        doc.text("STUDENT REPORT CARD", 100, 35, { align: 'center' });
    };
*/
    const schoolLogo = "data:image/png;base64,";
    doc.addImage(schoolLogo, 'PNG', 185, 5, 20, 20);

    // Save the PDF
    doc.save(`report_card_${student.admissionNumber}.pdf`);

}
